onal de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tools":[{"id":"1211"}]},"id":"1200","type":"Toolbar"},{"attributes":{"coordinates":null,"formatter":{"id":"1454"},"group":null,"major_label_policy":{"id":"1455"},"ticker":{"id":"1198"}},"id":"1197","type":"CategoricalAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"1495"},"group":null,"major_label_policy":{"id":"1496"},"ticker":{"id":"1379"}},"id":"1378","type":"DatetimeAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"1207"},"group":null,"major_label_orientation":-0.5,"major_label_policy":{"id":"1456"},"minor_tick_line_alpha":0,"ticker":{"id":"1209"}},"id":"1193","type":"LinearAxis"},{"attributes":{"months":[0,4,8]},"id":"1559","type":"MonthsTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Memory"},"id":"1250","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"1492"},"group":null,"major_label_policy":{"id":"1493"},"ticker":{"id":"1383"}},"id":"1382","type":"LinearAxis"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"},{"id":"1551"},{"id":"1552"},{"id":"1553"},{"id":"1554"},{"id":"1555"},{"id":"1556"},{"id":"1557"},{"id":"1558"},{"id":"1559"},{"id":"1560"},{"id":"1561"}]},"id":"1379","type":"DatetimeTicker"},{"attributes":{"below":[{"id":"1084"}],"center":[{"id":"1087"},{"id":"1091"}],"left":[{"id":"1088"}],"renderers":[{"id":"1106"}],"sizing_mode":"stretch_both","title":{"id":"1415"},"toolbar":{"id":"1097"},"x_range":{"id":"1076"},"x_sca
